// SPDX-License-Identifier: MIT
pragma solidity 0.8.18;

import './interfaces/IBridge.sol';
import './libraries/transferHelper.sol';
import './libraries/safeCaller.sol';

interface IAllBridge {
    enum MessengerProtocol {
        None,
        Allbridge,
        Wormhole,
        LayerZero
    }
    function swapAndBridge(
        bytes32 tokenAddress,
        uint256 amount,
        bytes32 recipient,
        uint8 destinationChainId,
        bytes32 receiveTokenAddress,
        uint256 nonce,
        MessengerProtocol messenger) external payable;
}

contract ALLBridge is IBridge {    
    address public bridge;

    struct allBridgeInput {
        uint256 totalAmount;
        bytes32 tokenAddress;
        bytes32 recipient;
        uint8 destinationChainId;
        bytes32 receiveTokenAddress;
        uint256 nonce;
        IAllBridge.MessengerProtocol messenger;
    }

    function Bridge(bytes calldata data,uint amountIn) public payable {
        (allBridgeInput memory input) = abi.decode(data,(allBridgeInput));

            address tokenAddress = address(uint160(uint256(input.tokenAddress)));
            TransferHelper.safeTransferFrom(tokenAddress,msg.sender,address(this),amountIn);
            TransferHelper.safeApprove(tokenAddress,bridge,amountIn);
            IAllBridge(bridge).swapAndBridge{value:msg.value}(
                input.tokenAddress,
                amountIn,
                input.recipient,
                input.destinationChainId,
                input.receiveTokenAddress,
                input.nonce,
                input.messenger);
    }


    function decode(bytes calldata data) public pure returns(allBridgeInput memory){
        return abi.decode(data,(allBridgeInput));
    }

}

